import{_ as e,c as o,o as a,d as t}from"./app.35408c59.js";const g=JSON.parse('{"title":"\u65E5\u5E38\u5B66\u4E60\u8BB0\u5F55","description":"","frontmatter":{"layout":"doc","title":"\u65E5\u5E38\u5B66\u4E60\u8BB0\u5F55"},"headers":[],"relativePath":"daily/index.md","lastUpdated":1672901701000}'),d={name:"daily/index.md"},i=t('<h1 id="\u5173\u4E8Ewukoon" tabindex="-1">\u5173\u4E8EWukoon <a class="header-anchor" href="#\u5173\u4E8Ewukoon" aria-hidden="true">#</a></h1><p>\u8FD9\u4E2A,\u5176\u5B9E\u5C31\u662F<code>\u609F\u7A7A</code>,\u6211\u539F\u6765\u7F51\u540D\u53EB<code>\u5357\u4EAC\u97F6\u90B5</code>\u6765\u7740,\u540E\u6765\u6D41\u884C\u7ED9\u7F51\u540D\u52A0\u4E0A\u4E2A\u5C0F\u5C3E\u5DF4,\u4E8E\u662F\u6211\u5C31\u6539\u540D\u53EB<code>\u5357\u4EAC\u97F6\u90B5\u4E0D\u8BF4\u8BDD</code>,\u518D\u540E\u6765\u5427,\u6211\u5728 <code>wolai</code> \u8FD9\u4E2A\u8F6F\u4EF6\u4E0A\u51C6\u5907\u8BB0\u5F55\u4E1C\u897F\u7684\u65F6\u5019,\u9700\u8981\u7ED9\u5DE5\u4F5C\u7A7A\u95F4\u53D6\u4E2A\u540D\u5B57,\u7A81\u7136\u8111\u5B50\u91CC\u5C31\u51FA\u73B0\u4E86\u4E00\u4E2A<code>\u609F</code>\u5B57,\u6700\u7EC8\u80FD\u609F\u5230\u5565,\u8FD8\u662F\u4E00\u5207\u90FD\u662F\u7A7A\u5462,\u5C31\u53EB<code>\u609F\u7A7A</code>\u5427.</p><p>\u81F3\u4E8E <code>Wukoon</code> \u8FD9\u4E2A,\u4E3B\u8981\u662F\u597D\u770B\u597D\u8BB0\u800C\u5DF2,\u800C\u4E14\u4E0D\u662F\u4E00\u4E2A\u6B63\u89C4\u7684\u5355\u8BCD,\u65E0\u8BBA\u6CE8\u518C\u4EC0\u4E48\u7F51\u7AD9,\u5F88\u5C11\u6709\u88AB\u5360\u7528\u7684\u60C5\u51B5,\u4E8E\u662F\u5C31\u5B9A\u4E0B\u4E86\u8FD9\u4E2A\u540D\u5B57.</p><h1 id="\u5173\u4E8E\u6211" tabindex="-1">\u5173\u4E8E\u6211 <a class="header-anchor" href="#\u5173\u4E8E\u6211" aria-hidden="true">#</a></h1><p>\u8FD9\u90E8\u5206,\u6211\u89C9\u5F97\u5E94\u8BE5\u7559\u70B9\u6C42\u804C\u5185\u5BB9\u5427,\u5DE5\u4F5C\u5341\u591A\u5E74\u4E86,\u7B80\u5386\u8981\u6574\u7406\u8D77\u6765\u4E5F\u5F88\u591A,\u4E8E\u662F\u6211\u5C31\u5728<code>wolai</code>\u4E0A\u5199\u4E86\u4E2A\u5728\u7EBF\u7684,\u5229\u7528\u6570\u636E\u8868\u683C\u4E4B\u7C7B\u7684\u5DE5\u5177,\u8FD8\u53EF\u4EE5\u6709\u70B9\u52A8\u6001\u6548\u679C,\u633A\u597D\u7684,\u6240\u4EE5,\u5173\u4E8E\u6211\u4E48,\u8BF7\u70B9\u51FB<a href="https://www.wolai.com/wukoon/oWY8xUGBeTHLRk1SBuqmJL" target="_blank" rel="noreferrer">\u5173\u4E8E\u6211</a></p><h1 id="\u5173\u4E8E\u672C\u535A\u5BA2" tabindex="-1">\u5173\u4E8E\u672C\u535A\u5BA2 <a class="header-anchor" href="#\u5173\u4E8E\u672C\u535A\u5BA2" aria-hidden="true">#</a></h1><p>\u5199\u4F5C\u8FD9\u4EF6\u4E8B\u60C5,\u8FD8\u662F\u5F88\u8003\u9A8C\u4EBA\u7684.\u603B\u89C9\u5F97\u6709\u5F88\u591A\u4E1C\u897F\u8981\u8F93\u51FA,\u4F46\u662F\u5230\u4E86\u8F93\u51FA\u7684\u65F6\u5019\u5C31\u4EC0\u4E48\u90FD\u5199\u4E0D\u51FA\u6765\u4E86.\u6240\u4EE5,\u8FD9\u4E2A\u535A\u5BA2\u4E5F\u9646\u9646\u7EED\u7EED\u7684\u641E\u8FC7\u5F88\u591A\u4E2A\u7248\u672C.</p><h2 id="\u6709\u4E9B\u574E\u5777" tabindex="-1">\u6709\u4E9B\u574E\u5777 <a class="header-anchor" href="#\u6709\u4E9B\u574E\u5777" aria-hidden="true">#</a></h2><p>\u6700\u5F00\u59CB\u7684\u65F6\u5019(\u5927\u7EA6\u662F 201X \u5E74\u5427,\u5177\u4F53\u4E5F\u4E0D\u77E5\u9053\u5565\u65F6\u5019\u4E86),\u77E5\u9053\u4E86 gitbub \u7684 pages \u670D\u52A1,\u53EF\u4EE5\u514D\u8D39\u7684\u53D1\u5E03\u4E00\u4E2A\u4E2A\u4EBA\u4E3B\u9875,\u6709\u70B9\u9177,\u4E8E\u662F\u7740\u624B\u51C6\u5907\u641E\u4E00\u4E2A\u81EA\u5DF1\u7684 Blog, \u8FD8\u8BB0\u5F97\u7B2C\u4E00\u7248\u4F7F\u7528\u7684\u662F Hexo \u8FD9\u4E2A\u5DE5\u5177,\u914D\u7F6E\u7565\u590D\u6742,\u5F04\u4E86\u534A\u5929,\u6700\u7EC8\u6210\u529F\u4E86,\u4F46\u662F\u540E\u6765\u89C9\u5F97\u5199\u4E1C\u897F\u6BD4\u8F83\u9EBB\u70E6,\u5C31\u6CA1\u600E\u4E48\u5199\u8FC7\u4E1C\u897F.</p><p>\u518D\u540E\u6765,\u4E0A\u7F51\u627E\u4E86\u4E00\u5806\u6398\u91D1\u5C0F\u518C,\u7528 docsify \u8FD9\u4E2A\u5DE5\u5177\u7EC4\u7EC7\u4E86\u4E00\u4E0B,\u5C06\u539F\u6765 Blog \u66FF\u6362\u6389\u4E86,\u4E3B\u8981\u662F\u4E3A\u4E86\u81EA\u5DF1\u6CA1\u4E8B\u770B\u770B.\u4F46\u4E8B\u5B9E\u4E0A,\u81EA\u5DF1\u4E5F\u4E0D\u4F1A\u53BB\u770B.\u4E8E\u662F\u53C8\u6401\u7F6E\u4E86.</p><p>\u518D\u540E\u6765,\u89C9\u5F97\u81EA\u5DF1\u642D\u5EFA Blog,\u7EF4\u62A4\u9EBB\u70E6,\u770B\u5F97\u4EBA\u4E5F\u5C11,\u5982\u679C\u53EA\u662F\u8BB0\u5F55\u70B9\u4E1C\u897F,\u5E76\u4E0D\u9700\u8981\u8FD9\u4E2A,\u4E8E\u662F\u5C06\u5F88\u591A\u6587\u7AE0\u5199\u5728\u4E86 github \u7684 gist \u91CC\u9762,\u4E0A\u7F51\u627E\u4E86\u4E00\u4E2A gist \u7F16\u8F91\u5DE5\u5177,\u8FDE\u63A5\u5230\u81EA\u5DF1\u7684 github \u8D26\u53F7,\u5199\u70B9\u4E1C\u897F\u4E5F\u65B9\u4FBF,\u968F\u624B\u5C31\u80FD\u641E\u5B9A,\u8F93\u51FA\u4E86\u4E0D\u5C11\u6587\u7AE0,\u4E5F\u628A\u4E4B\u524D\u9646\u9646\u7EED\u7EED\u5199\u7684\u4E1C\u897F\u79FB\u5230\u4E86 gist \u4E0A.</p><p>\u518D\u540E\u6765,\u53D1\u73B0\u4E86\u4E00\u4E2A\u53EB wolai \u7684\u56FD\u4EA7\u8F6F\u4EF6,\u4F3C\u4E4E\u662F Notion \u7684\u56FD\u66FF,\u9002\u7528\u4E86\u4E00\u4E0B,\u611F\u89C9\u529F\u80FD\u5F88\u559C\u6B22,\u4E5F\u53EF\u4EE5\u5728\u7EBF\u5206\u4EAB,\u5F88\u662F\u65B9\u4FBF,\u4E8E\u662F\u628A\u81EA\u5DF1\u5B66\u4E60\u7684\u7B14\u8BB0\u8D44\u6599\u4E00\u80A1\u8111\u7684\u5168\u90FD\u653E\u5230\u4E86 wolai \u4E0A.</p><p>\u6700\u540E,\u5C31\u662F\u8FD9\u4E2A Blog \u4E86,\u673A\u7F18\u5DE7\u5408,\u4E3A\u516C\u53F8\u8C03\u7814\u4E00\u4E0B\u6587\u6863\u5DE5\u5177,\u51C6\u5907\u4E3A\u516C\u53F8\u4EA7\u54C1\u53D1\u5E03\u4E00\u4E2A\u5F00\u53D1\u6587\u6863,\u6700\u7EC8\u9009\u5230\u4E86 Vitepress ,\u65B9\u4FBF,\u5FEB\u6377,\u7B80\u5355\u914D\u7F6E\u5C31\u53EF\u4EE5\u4F7F\u7528,\u4E13\u6CE8\u4E8E\u5185\u5BB9\u8F93\u51FA\u5C31\u53EF\u4EE5\u4E86.</p><p>\u4F46\u662F\u8BA9\u6211\u52A8\u624B\u505A\u8FD9\u4E2A Blog \u7684\u6700\u6839\u672C\u539F\u56E0\u662F,\u6211\u9700\u8981\u4E00\u4E2A\u9759\u6001\u9875\u9762\u6765\u663E\u793A\u6211\u7684\u5907\u6848\u53F7,\u56FD\u5185\u7684\u57DF\u540D\u90FD\u9700\u8981\u5907\u6848,\u800C\u4E14\u5907\u6848\u53F7\u9700\u8981\u663E\u793A\u5728\u9875\u9762\u4E0A,\u8981\u4E0D\u7136\u5BA1\u6838\u4E0D\u8FC7\u4F1A\u88AB\u6536\u56DE,\u4E8E\u662F\u6211\u5C31\u60F3,\u6211\u6258\u7BA1\u4E00\u4E2A\u9759\u6001\u9875\u9762,\u628A\u5907\u6848\u53F7\u4E22\u5728\u9759\u6001\u9875\u9762\u4E0A,\u4EE5\u540E\u4E0D\u7BA1\u600E\u67E5,\u90FD\u6CA1\u95EE\u9898\u4E86,\u4E8E\u662F\u5C31\u642D\u4E86\u4E00\u4E2A\u7A7A\u7684 Vitepress \u9996\u9875.</p><h2 id="\u65B0\u7684\u5F00\u59CB" tabindex="-1">\u65B0\u7684\u5F00\u59CB <a class="header-anchor" href="#\u65B0\u7684\u5F00\u59CB" aria-hidden="true">#</a></h2><p>\u5FEB\u8FC7\u5E74\u4E86,\u516C\u53F8\u9879\u76EE\u4E0D\u592A\u5FD9,\u4E8E\u662F\u5F00\u59CB\u7F51\u4E0A\u627E\u70B9\u6587\u7AE0,\u968F\u673A\u5B66\u4E60\u4E00\u4E9B\u4E1C\u897F,\u5B66\u5230\u4E86 Github Actions \u8FD9\u4E2A\u81EA\u52A8\u5316\u5DE5\u5177,\u4E8E\u662F\u51B3\u5B9A\u628A Blog \u9879\u76EE\u5347\u7EA7\u4E00\u4E0B,\u5229\u7528 Github Actions \u81EA\u52A8\u5316\u6253\u5305\u90E8\u7F72,\u4EE5\u540E\u53EA\u9700\u8981\u7EF4\u62A4\u8FD9\u4E2A Blog \u7684\u4EE3\u7801\u9879\u76EE\u5C31\u53EF\u4EE5\u4E86,\u5206\u652F\u63A8\u9001,\u81EA\u52A8\u53D1\u5E03,\u8FD9\u5C31\u5F88\u9177. \u8BF4\u5E72\u5C31\u5E72,\u642D\u5EFA\u7ED3\u675F,\u89C9\u5F97\u5F88\u6709\u610F\u601D,\u4E8E\u662F\u51B3\u5B9A\u628A\u642D\u5EFA\u8FC7\u7A0B\u4F5C\u4E3A\u8FD9\u4E2A Blog \u7684\u7B2C\u4E00\u7BC7\u8F93\u5165\u5427.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>\u53CD\u6B63\u4E5F\u6CA1\u4EBA\u770B,\u5C31\u8FD9\u6837\u5427</p></div>',17),c=[i];function r(s,n,p,h,l,_){return a(),o("div",null,c)}const f=e(d,[["render",r]]);export{g as __pageData,f as default};
